    [],nt"revision_timestamp": "2016-07-27T22:42:19.959254",nt"name": "review-of-witmer-2011-retention-time-of-chlorophacinone-in-the-tissues-of-black-tailed-pra",nt"isopen":
    false,nt"url": null,nt"notes": "Witmer (2011) provides valuable information
    on prairie dog chlorophacinone excretion, residue concentrations, and observed effects
    from toxicity; however, the limited prairie dog exposure to chlorophacinone bait
    in the current study underestimates what would occur during a field application.
    For reasons specified in our enclosed review, the amount of bait (53 grams each)
    and time of exposure (1-2 days) for the lab study are much lower than what would
    be expected for a field application. Concentrations of chlorophacinone in prairie
    dog tissues from the current study exceeded those previously reported for common
    voles (Vidal et al., 2009) but were lower than those previously reported for prairie
    dogs carcasses retrieved 11 days after a field application (Primus, 2007). Study
    results also indicate that chlorophacinone is metabolized over time so that death
    may occur after the parent compound is nearly gone. Therefore, u201ctrace amountsu201d
    of chlorophacinone, as reported previously in raptor diagnostic necropsy examination
    reports, should be considered as acceptable evidence that rodenticide exposure may
    have attributed to untimely death. Furthermore the behavioral incapacitation and
    lethargy effects of chlorophacinone may result in raptors being more susceptible
    to being shot or hit by vehicles or succumbing to injuries that would typically
    be considered non-life threatening (e.g., territorial infighting or capture of prey).
    The primary weakness of the current study is that it underestimates the amount of
    bait available, and the length of time bait is available, compared to field applications.
    Although three prairie dogs were offered ad libitum Rozol for two days (T2 group),
    valid conclusions cannot inferred from the T2 group due to small sample size, the
    limited 2 days of ad libitum availability and variability in the amount of bait
